import "./Footer.css"
function Footer(){
    const github = require("./Icons/github.png");
    const linkedin = require("./Icons/linkedin.png");
    const facebook = require("./Icons/facebook.png");
    const mail = require("./Icons/mail.png");

    return(
        <footer>
            <a href="https://github.com/asiradnan" target="_blank"><img src={git}/></a>
            <a href="https://www.linkedin.com/in/asiradnan" target="_blank"><img src="./Icons/linkedin.png"/></a>
            <a href="https://youtube.com/@AsironScreen?si=KEwE1loeWyuPD94J" target="_blank"><img src="./Icons/youtube.png"/></a>
            <a href="https://web.facebook.com/asiradnan23/" target="_blank"><img src="./Icons/facebook.png"/></a>
            <a onclick="email()" href="#"><img src="./Icons/mail.png"/></a>
        </footer>
    );
}
export default Footer;
